(function (Scratch) {
  'use strict';
  
  const rgbToHex = (r, g, b) => {
    return "#" + (1 << 24 | r << 16 | g << 8 | b).toString(16).slice(1);
  }

  const hexToRgb = (hex) => {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    return result ? {
      r: parseInt(result[1], 16),
      g: parseInt(result[2], 16),
      b: parseInt(result[3], 16)
    } : null;
  }
  
  const itemOfFromString = (item, from, splitby) => {
    var input1 = (item - 1);
    var input2 = String(from);
    var input3 = splitby;
    var output = input2.split(input3)[input1] || '';
    return output;
  }

  const getrgb = (rgb) => {
    var rgb = rgb.replace("rgb(", "").replace(")", "");
    var result = [itemOfFromString("1", rgb, ","), itemOfFromString("2", rgb, ","), itemOfFromString("3", rgb, ",")];
    return result ? {
      r: result[0],
      g: result[1],
      b: result[2]
    } : null;
  }

  const setrgb = (r, g, b) => {
    return "rgb(" + r + "," + g + "," + b + ")";
  }

  const invertColor = (hex) => {
    if (hex.indexOf('#') === 0) {
        hex = hex.slice(1);
    }
    // convert 3-digit hex to 6-digits.
    if (hex.length === 3) {
        hex = hex[0] + hex[0] + hex[1] + hex[1] + hex[2] + hex[2];
    }
    if (hex.length !== 6) {
        throw new Error('Invalid HEX color.');
    }
    // invert color components
    var r = (255 - parseInt(hex.slice(0, 2), 16)).toString(16),
        g = (255 - parseInt(hex.slice(2, 4), 16)).toString(16),
        b = (255 - parseInt(hex.slice(4, 6), 16)).toString(16);
    // pad each with zeros and return
    return '#' + padZero(r) + padZero(g) + padZero(b);
  }

  const padZero = (str, len) => {
    len = len || 2;
    var zeros = new Array(len).join('0');
    return (zeros + str).slice(-len);
  }

  const hexToCssHsl = (hex, valuesOnly = false) => {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var r = parseInt(result[1], 16);
    var g = parseInt(result[2], 16);
    var b = parseInt(result[3], 16);
    var cssString = '';
    r /= 255, g /= 255, b /= 255;
    var max = Math.max(r, g, b), min = Math.min(r, g, b);
    var h, s, l = (max + min) / 2;
    if (max == min) {
      h = s = 0; // achromatic
    } else {
      var d = max - min;
      s = l > 0.5 ? d / (2 - max - min) : d / (max + min);
      switch(max) {
        case r: h = (g - b) / d + (g < b ? 6 : 0); break;
        case g: h = (b - r) / d + 2; break;
        case b: h = (r - g) / d + 4; break;
      }
      h /= 6;
    }
    
    h = Math.round(h * 360);
    s = Math.round(s * 100);
    l = Math.round(l * 100);
    
    cssString = h + ',' + s + '%,' + l + '%';
    cssString = !valuesOnly ? 'hsl(' + cssString + ')' : cssString;
    
    return cssString;
  }

  const hslToHex = (h, s, l) => {
    var s = s.replace("%", "")
    var l = l.replace("%", "")
    l /= 100;
    const a = s * Math.min(l, 1 - l) / 100;
    const f = n => {
      const k = (n + h / 30) % 12;
      const color = l - a * Math.max(Math.min(k - 3, 9 - k, 1), -1);
      return Math.round(255 * color).toString(16).padStart(2, '0');   // convert to Hex and prefix "0" if needed
    };
    return `#${f(0)}${f(8)}${f(4)}`;
  }

  const gethsl = (hsl) => {
    var hsl = hsl.replace("hsl(", "").replace(")", "");
    var result = [itemOfFromString("1", hsl, ","), itemOfFromString("2", hsl, ","), itemOfFromString("3", hsl, ",")];
    return result ? {
      h: result[0],
      s: result[1],
      l: result[2]
    } : null;
  }
  const sethsl = (h, s, l) => {
    return "hsl(" + h + "," + s + "," + l + ")";
  }

  const icon = 'data:image/svg+xml;base64,';
  
  class ColorPlus {
    constructor () {}
      getInfo() {
        return {
          id: 'colorplus',
          name: 'Color +',
          color1: '#80d65c',
          color2: '#80d65c',
          color3: '#80d65c',
          menuIconURI: icon,
          blocks: [
            {
              opcode: 'colorHex',
              blockType: Scratch.BlockType.REPORTER,
              text: 'color [COLOR]',
              arguments: { 
                COLOR: {
                  type: Scratch.ArgumentType.COLOR,
                  defaultValue: '#99ff6d'
                }
              }
            },
            {
              opcode: 'colorRGB',
              blockType: Scratch.BlockType.REPORTER,
              text: 'R [R] G [G] B [B]',
              arguments: { 
                R: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: '153'
                },
                G: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: '255'
                },
                B: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: '109'
                }
              }
            },
            {
              opcode: 'colorHSL',
              blockType: Scratch.BlockType.REPORTER,
              text: 'H [H] S [S]% L [L]%',
              arguments: { 
                H: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: '0'
                },
                S: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: '0'
                },
                L: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: '100'
                }
              }
            },
            {
              opcode: 'colorBrightness',
              blockType: Scratch.BlockType.REPORTER,
              text: 'brightness of [COLOR] in percent',
              arguments: { 
                COLOR: {
                  type: Scratch.ArgumentType.COLOR,
                  defaultValue: '#99ff6d'
                }
              }
            },
            {
              opcode: 'getcolornegative',
              blockType: Scratch.BlockType.REPORTER,
              text: 'negative of [COLOR]',
              arguments: { 
                COLOR: {
                  type: Scratch.ArgumentType.COLOR,
                  defaultValue: '#ffffff'
                }
              }
            },
            {
              opcode: 'turnto',
              blockType: Scratch.BlockType.REPORTER,
              text: 'turn [COLOR] from [INPUT_FORMAT] to [OUTPUT_FORMAT]',
              arguments: { 
                COLOR: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: '#99ff6d'
                },
                INPUT_FORMAT: {
                  type: Scratch.ArgumentType.STRING,
                  menu: 'color_format',
                  defaultValue: 'hex'
                },
                OUTPUT_FORMAT: {
                  type: Scratch.ArgumentType.STRING,
                  menu: 'color_format',
                  defaultValue: 'rgb'
                }
              }
            }
          ],
          menus: {
            color_format: {
              acceptReporters: false,
              items: ['hex', 'rgb', 'hsl']
            }
          }

        };
      }

    colorHex (args){
      return args.COLOR;
    }

    colorRGB (args){
      return "rgb(" + args.R + "," + args.G + "," + args.B + ")";
    }

    colorHSL (args){
      return "hsl(" + args.H + "," + args.S + "%," + args.L + "%)";
    }

    colorBrightness (args){
      var color = "" + args.COLOR, isHEX = args.COLOR.indexOf("#") == 0, isRGB = args.COLOR.indexOf("rgb") == 0;
      if (isHEX) {
        const hasFullSpec = color.length == 7;
        var m = color.substr(1).match(hasFullSpec ? /(\S{2})/g : /(\S{1})/g);
        if (m) var r = parseInt(m[0] + (hasFullSpec ? '' : m[0]), 16), g = parseInt(m[1] + (hasFullSpec ? '' : m[1]), 16), b = parseInt(m[2] + (hasFullSpec ? '' : m[2]), 16);
      }
      if (isRGB) {
        var m = color.match(/(\d+){3}/g);
        if (m) var r = m[0], g = m[1], b = m[2];
      }
      if (typeof r != "undefined") return ((r*299)+(g*587)+(b*114))/1000/2.55;
    }

    getcolornegative (args){
      return invertColor(args.COLOR);
    }

    turnto (args){
      if (args.INPUT_FORMAT == args.OUTPUT_FORMAT){
        return args.COLOR;
      } else {
        if (args.INPUT_FORMAT == "rgb"){
          if (args.OUTPUT_FORMAT == "hex"){
            var rgb = getrgb(args.COLOR);
            return rgbToHex(rgb.r, rgb.g, rgb.b);
          } else if (args.OUTPUT_FORMAT == "hsl"){
            var rgb = getrgb(args.COLOR);
            var hex = rgbToHex(rgb.r, rgb.g, rgb.b);
            return hexToCssHsl(hex);
          }
        } else if (args.INPUT_FORMAT == "hex"){
          if (args.OUTPUT_FORMAT == "rgb"){
            var rgb = hexToRgb(args.COLOR);
            return "rgb(" + rgb.r + "," + rgb.g + "," + rgb.b + ")";
          } else if (args.OUTPUT_FORMAT == "hsl"){
            return hexToCssHsl(args.COLOR);
          }
        } else if (args.INPUT_FORMAT == "hsl"){
          if (args.OUTPUT_FORMAT == "hex"){
            var hsl = gethsl(args.COLOR);
            return hslToHex(hsl.h, hsl.s, hsl.l);
          } else if (args.OUTPUT_FORMAT == "rgb"){
            var hsl = gethsl(args.COLOR);
            var hex = hslToHex(hsl.h, hsl.s, hsl.l);
            var rgb = hexToRgb(hex);
            return setrgb(rgb.r, rgb.g, rgb.b);
          }
        }
      }
    }
  }
  Scratch.extensions.register(new ColorPlus());
})(Scratch);